PFX is a short for prefix. Every function generated will be within this namespace . When using Intellisense , write whichever prefix you gave to your functions and everything will be in there. Functions that are part of the implementation and shouldn't be called directly are prefixed by PFX and then by _impl_. Every iterator function will be prefixed by PFX and then by _iter_. For example: // A function that you shouldn't use directly
size_t PFX##_impl_quick_sort(struct SNAME *list); // A function that is associated with the iterator
struct SNAME##_iter *PFX##_iter_new(struct SNAME *target);

