// Allocate an int_list with an initial capacity of 100
int_list *list = il_new(100); // Adding elements to the back of the list
for (int i = 0; i <= 1000; i++)
{ if (!il_push_back(list, i)) { // Something went wrong (check out documentation) }
} To initialize any collection we call a function _new. Since the PFX parameter is set to il all functions related to our list of integer will be prefixed by il, so _new becomes il_new. The list name is int_list as defined by SNAME. This type is a typedef like: typedef struct SNAME##_s SNAME; Which expands to: typedef struct int_list_s int_list To add elements to the back of a list we can use il_push_back. This function will first check if the list has enough space for a new element. If not, reallocate the internal buffer with doubled size and then add the new element.

