It is recommended that the iterator is allocated on the stack // Resulting sum will be stored here
int sum = 0; // Declare our iterator (allocating it on the stack)
int_list_iter it; // Loop for each element
for (il_iter_init(&it, list); !il_iter_end(&it); il_iter_next(&it))
{ // Accessing the value int elem = il_iter_value(&it); sum += elem;
} printf("%d\n", sum); There are 6 (2 optional) steps to iterate over the elements of any collection: Step Description Function 1 Allocate the iterator (optional) il_iter_new 2 Initialize the iterator given a target list il_iter_init 3 Access the iterator's elements (value, index, etc) il_iter_value 4 Go to the next element il_iter_next 5 Check if we haven't reached the end of the list il_iter_end 6 Free the iterator if it was allocated on the heap il_iter_free Note that all iterator functions are prefixed by the user defined prefix and then by iter (il + iter = il_iter). Also, the steps 1 and 6 are optional so il_iter_new and il_iter_free are not used in the example. By the end of the example we have the variable sum with the sum of all integers inside our list. We can then print it and this example is almost done.

