source.c #include <cmc/list.h> CMC_GENERATE_LIST(il, int_list, int) int main(void)
{ int_list *list = il_new(100); for (int i = 0; i <= 1000; i++) { if (!il_push_back(list, i)) { // Something went wrong (check out documentation) } } int sum = 0; int_list_iter it; for (il_iter_init(&it, list); !il_iter_end(&it); il_iter_next(&it)) { int elem = il_iter_value(&it); sum += elem; } printf("%d\n", sum); il_free(list, NULL);
} If the source file is source.c, all you have to do is to include the src folder to the include path and compile. The following example uses gcc: gcc source.c -I path/to/library/src
